import React from 'react';

const Footer = () => {
    return (
        <>
            <footer className="w-100 mt-5 bg-light text-center p-2">
                <h6>&copy; 2020 Robox Asus. All Rights Reserved | Terms and Condition Applied </h6>
                <h6>Robox Asus, Earth, Universe, Milky Galaxy, Space</h6>
            </footer>
        </>
    );

};

export default Footer;
